import react from "react";

import { Link } from "react-router-dom";

export default function Header() {
  return (
    <div className="header">
      {/* <ul className="forlogin"> */}
        <ul className="navbar">
        <li className="logo">
          <span>SomeLogo</span>
        </li>
        <li className="forlogin">
          <Link to="/login">
            <span>Login</span>
          </Link>
        </li>
        <li className="forreg">
          <Link to="/registration">
            <span>Register</span>
          </Link>
        </li>
      </ul>
    </div>
  );
}
